package packageA;

public class ClassA {

	int a =10;
	private int b =25;
	protected int c=30;
	public int d=50; 
		
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		ClassA obj = new ClassA();
		System.out.println(obj.a);
		System.out.println(obj.b);
		System.out.println(obj.c);
		System.out.println(obj.d);
		}

}
